⚡️По данным источников БК, онлайн-платформа Netflix остановила работу над российскими оригинальными проектами. 

Известно, что видеосервис работал с отечественными продюсерами над четырьмя проектами:
• драматический сериал «Анна К» со Светланой Ходченковой в главной роли (производства 1-2-3 Production и «Друг Друга»);
• сериал с Александром Петровым (производства компании «Водород» и «Манки Стайл»);
• сериал «Ничего особенного» с Юрой Борисовым студии 1-2-3 Production;
• криминальный триллер «Зато» Дарьи Жук (продюсеры – Ирина Смирнова и Александр Кушаев).

Материал дополняется.

Ну что, теперь внутренний туризм заиграл новыми красками и перспективами - хотите вы этого или нет. Как говорит #светскаяПош, чем богаты, тем и богаты - но! - если без шуток, спасибо нашим рестораторам, что нормально взялись за регионы. В Красной поляне, например, открылась вторая Ikra by WRF - кто был в первой в Плёсе, тот поймёт причину нашего оптимизма. 

Мы, кстати, сами скатались на минувших выходных и продегустировали дегустационный сет «Медовиеи», ради которого смело можно полдня голодать, если вы вдруг интервально голодающий. Единственный соблазн, от которого устояла наша Юля - свежайший хлеб - остальные же гости, скорее, были готовы отказать себе в следующем завтраке. Весомости сету добавили также шампанское Lanson и коктейль на основе Grey Goose,(!) мухоморов и деревянных конфет, что бы это ни значило. Нет, после Мухоморов похмелья нет - проверено.  

Обещают, что «Икра» расползется и дальше по России - в карте гастрозахвата ресторатора Зарькова уже отмечены, например, Суздаль и Териберка. Так что нам будет, чем заняться летом при любом раскладе.
